import React, {Component} from 'react';

import './App.css';

class App extends Component {

    apiKey = 'keys';

    constructor(props) {
        super(props);

        this.state = {
            searchTerm: "",
            searchUrl:  ""
        }
    }

    render() {
        return (
            <div className="App">
                <h1>hello</h1>
            </div>
        );
    }
}

export default App;
